script: |
  super -f text -I q4430.spq | sort > q4430.out

inputs:
  - name: q4430.spq
    data: |
      SELECT DISTINCT - - col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE col0 - + col0 NOT BETWEEN NULL AND - col0 * + 43 * + col2 + + + col1 + + - 17 + + col0 / - col0;
  - name: tab1

outputs:
  - name: q4430.out
    data: |
      59
      68
      96
